function OnAfterTransform(platform, transformContext) {
  var criteria = platform.GetDataSource().CreateCriteria();
  criteria = platform.GetDataSource().CreateCriteria();
  res = platform.GetDataSource().ExecuteLoadDefaults('kahua_AEC_RFI.RFIData', criteria);

  if (res.Entities.Count > 0)
  {         
    for (var a = 0; a < res.Entities[0].Attributes.Count; a++)
    {
        var found = false;
        var attr = res.Entities[0].Attributes[a];
        var target = transformContext.Target;
        for (var t = 0; t < target.Attributes.Count; t++)
        {
          if (target.Attributes[t].Name == attr.Name)
          {
              found = true;
              break;
          }
        }
        if (!found)
        {
            target.AddAttribute(attr);
        }
    }
  } 
}

function OnAfterLoadDefaults(platform, loadDefaultsContext) 
{
  if (loadDefaultsContext.Parameters.HasParameter('AdditionalEntityId') && loadDefaultsContext.Parameters.GetParameterValue('AdditionalEntityId') != '') 
  {                 
    var additionalEntityId = loadDefaultsContext.Parameters.GetParameterValue('AdditionalEntityId');
    if ((additionalEntityId == null) || (additionalEntityId == ''))
    {
      return;
    }

    var selectBuilder = platform.GetEntity().CreateSelectBuilder();
    selectBuilder.Select('Number');
    selectBuilder.Select('Subject');

    var entityAsLong = platform.ParseInt(additionalEntityId);
    var entity = platform.GetEntity().Get('kahua_AEC_RFI.RFI', entityAsLong, selectBuilder);
    if (entity == null)                  
    {
      return;
    }
    var number = entity.GetValueText('Number');
    var subject = entity.GetValueText('Subject');


    var messageEntity = loadDefaultsContext.EntitySet.Entities[0];                  
    messageEntity.SetValueText('kahua_Message.Subject', number + ' ' + subject);

  }
}

        function transformAttributeWithLookup(platform, transformContext, attributeName, matchAttributeName, dataSourceName)
          {
            var targetEntity = transformContext.Target;

            var sourceEntity = transformContext.OriginalSource;
            if (sourceEntity == null)
            {
              sourceEntity = transformContext.Source;
            }

            var sourceAttribute = sourceEntity.GetValueEntity(attributeName);
            if (sourceAttribute != null && sourceAttribute.Entities.Count > 0)
            {
              var targetAttribute = targetEntity.GetValueEntity(attributeName);

              criteria = platform.GetDataSource().CreateCriteria();
					    criteria.PartitionId = targetEntity.Key.PartitionId;
              var targetLookup = platform.GetDataSource().Execute(dataSourceName, criteria);

              for (var i = 0; i < sourceAttribute.Entities.Count; i++)
              {
                var sourceAttributeEntity = sourceAttribute.Entities[i];

                if (sourceAttributeEntity.IsEmpty(matchAttributeName))
                {
                  sourceAttributeEntity = platform.GetEntity().GetWithAttribute(sourceAttributeEntity.EntityDef, sourceAttributeEntity.Key.Id, matchAttributeName);
                }

                if (sourceAttributeEntity == null || sourceAttributeEntity.IsEmpty(matchAttributeName))
                {
                  continue;
                }

                for (var j = 0; j < targetLookup.Entities.Count; j++)
                {
                  if (targetLookup.Entities[j].GetValueText(matchAttributeName) == sourceAttributeEntity.GetValueText(matchAttributeName))
                  {
                    targetAttribute.AddEntity(targetLookup.Entities[j]);
                    break;
                  }
                }
              }
            }
          }
